description:
Verenigde Staten
Horror / Thriller
105 minuten

goed

met Scout Taylor-Compton, Malcolm McDowell en Tyler Mane

Het is weer Halloween en Michael Myers keert terug naar zijn geboortedorp om wat onafgemaakte ''familiezaken'' op te lossen. Zijn 
zus Laurie is na haar laatste ontmoeting met Michael in het ziekenhuis beland. Ze denkt dat ze hem heeft vermoord, maar de 
gehavende Michael Myers jaagt op haar, geplaagd door jeugdherinneringen. Een spoor van dood en verderf volgt...
